import React, { Fragment } from "react";
import { Header } from "components/widgets";
import { useCustomState } from "state/state";
import { makeStyles } from '@material-ui/core/styles';
import InputLabel from '@material-ui/core/InputLabel';
import MenuItem from '@material-ui/core/MenuItem';
import FormHelperText from '@material-ui/core/FormHelperText';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';

const useStyles = makeStyles((theme) => ({
  formControl: {
    margin: theme.spacing(1),
    minWidth: 120,
  },
  selectEmpty: {
    marginTop: theme.spacing(2),
  },
}));

export default () => {
  const state = useCustomState()[0];
  const classes = useStyles();

  return (
    <Fragment>
      <Header img={state.data.header_bgs.contacts}>관광지 개별입력</Header>
      <div>
      <FormControl className={classes.formControl}>
        <InputLabel htmlFor="grouped-native-select">대분류 (cat1)</InputLabel>
        <Select native defaultValue="" id="grouped-native-select">
          <option aria-label="None" value="" />
          <optgroup label="Category 1">
            <option value={1}>A01</option>
            <option value={2}>A02</option>
            <option value={3}>A03</option>
            <option value={4}>A04</option>
            <option value={5}>A05</option>
          </optgroup>
          <optgroup label="Category 2">
            <option value={3}>Option 3</option>
            <option value={4}>Option 4</option>
          </optgroup>
        </Select>
      </FormControl>
      </div>
    </Fragment>
  );
};
